create table film
(
    id           integer      not null
        primary key,
    title        varchar(255) not null,
    year         integer,
    release_date date         not null,
    duration     integer      not null,
    age_category varchar(255),
    genre        varchar(255),
    description  varchar(255),
    director     varchar(255),
    actors       varchar(255),
    image_url    varchar(255)
);

alter table film
    owner to postgres;

